/** @format */

import React from "react";
import styled from "styled-components";
import MenuCard from "./MenuCard";
const MenuBlock = styled.div`
  width: 100%;
  height: 150px;
  background-color: yellow;
  margin-bottom: 5vh;
`;

const MenuBox = () => {
  return (
    <MenuBlock>
      <MenuCard />
    </MenuBlock>
  );
};

export default MenuBox;
